pragma solidity ^0.8.10;

contract CheckRand  {

    constructor() {}
    uint256 val;

    function changeState(uint256 n) external {
        val = n;
    }

    function _getRandomNumber(uint256 mod, uint256 r)
        external
        view
        returns (uint256)
    {
        // uint256 rndmBlock = uint256(keccak256(abi.encodePacked(r))) % 255;
        uint256 random = uint256(
            keccak256(
                abi.encodePacked(
                    blockhash(block.number - 1),
                    gasleft(),
                    block.timestamp,
                    msg.sender,
                    mod,
                    r
                )
            )
        );
        return random % mod;
    }

    function _returnTime() external view returns(uint32) {
        uint32 time = uint32(block.timestamp);
        return ( time );
    }
}

